import { useState } from "react"

export const Header = () => {

    const [todo , setTodo] = useState("")




    return (
        <div>

            <header className="header">
                {todo}
                <h1>todos</h1>
                <form onSubmit={e=>{e.preventDefault();}}>
                    <input onChange={e=>setTodo(e.target.value)} className="new-todo" placeholder="What needs to be done?" autoFocus />
                </form>
            </header>
        </div>
    )
}
